(171, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:50:\"8 Black Friday Marketing Strategies & Ideas (2021)\";s:7:\"excerpt\";s:138:\"Increase profits from upcoming seasonal sales with these 8 Black Friday marketing tips. Make sure your WordPress website comes out on top!\";s:7:\"created\";i:1634704980;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:122:\"https://elementor.com/blog/black-friday-marketing/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:40:\"HappyAddons Thought Leadership Interview\";s:7:\"excerpt\";s:283:\"The Thought Leadership Addons series continues with an interview with Nizam Uddin, CEO and Co-Founder of weDevs, about their plugin for Elementor, HappyAddons. Learn about their background, growth, new releases, and what exciting plans and widgets they have in store for the future. \";s:7:\"created\";i:1634638252;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:141:\"https://elementor.com/blog/happy-addons-thought-leadership-interview/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:36:\"Elementor Websites of September 2021\";s:7:\"excerpt\";s:200:\"The “homepage is where the art is” in this September’s spectacular showcase. Featuring websites across the board from all around the world, this is a collection as refreshing as a spring shower.\";s:7:\"created\";i:1634145544;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/showcase-september-2021/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:45:\"15 Brand-New Elementor Landing Page Templates\";s:7:\"excerpt\";s:143:\"Browse through 15 professionally designed landing page templates, available to all Elementor Expert members (Expert, Studio, and Agency plans).\";s:7:\"created\";i:1634048355;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:126:\"https://elementor.com/blog/new-landing-page-templates/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:89:\"8 Examples of High-Converting Mobile Landing Pages (& What Marketers Can Learn From Them)\";s:7:\"excerpt\";s:179:\"65% of search traffic and 80%+ Facebook traffic is mobile today. Is your mobile landing page ready to handle this traffic? This guide will show you how to design yours to convert.\";s:7:\"created\";i:1633513719;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/mobile-landing-page/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
