(11, 1, '2021-10-27 05:14:35', '2021-10-27 05:14:35', 'Welcome to {{site.name}}!\n\nVisit your <a href=\"{{{profile.url}}}\">profile</a>, where you can tell us more about yourself, change your preferences, or make new connections, to get started.\n\nForgot your password? Don\'t worry, you can reset it with your email address from <a href=\"{{{lostpassword.url}}}\">this page</a> of our site', '[{{{site.name}}}] Welcome!', 'Welcome to {{site.name}}!\n\nVisit your profile, where you can tell us more about yourself, change your preferences, or make new connections, to get started: {{{profile.url}}}\n\nForgot your password? Don\'t worry, you can reset it with your email address from this page of our site: {{{lostpassword.url}}}', 'publish', 'closed', 'closed', '', 'site-name-welcome', '', '', '2021-10-27 05:14:35', '2021-10-27 05:14:35', '', 0, 'http://localhost/eCommerceProject-SocialNetwork/?post_type=bp-email&p=11', 0, 'bp-email', '', 0),
